import React from "react";
import "./style.css";


export default function WorksScreen() {

    return (
      <div className="works-screen">
        <a className="image-cards">
          <div className="big-card"><img /></div>
          <div className="big-card"></div>
          <div className="big-card"></div>
          <div className="big-card"></div>

          <div className="small-card"></div>
          <div className="small-card"></div>
          <div className="small-card"></div>
          <div className="small-card"></div>
        </a>
      </div>
    );
}
